import React, { useEffect, useState } from 'react';

export default function Contactusinput() {
    const [items, setItems] = useState([]);
    const [title, setTitle] = useState('');
    const [is_done, setStatus] = useState(false);

    //Post function
    //     const saveinfo = async (e) => {
    //         e.preventDefault();
    //         if (!title.trim()) return;

    //         const res = await fetch('http://localhost:5000/items', {
    //             method: 'POST',
    //             headers: { 'Content-Type': 'application/json' },
    //             body: JSON.stringify({ title, is_done }),
    //         });

    //         const newItems = await res.json();
    //         setItems([...items, newItems]);
    //         setTitle('');
    //         setStatus(false);
    //     };

    //     const [formData, setFormData] = useState({
    //     FName: '',
    //     LName: '',
    //     Company: '',
    //     Phone: '',
    //     Message: ''
    //   });

    //   const handleChange = (e) => {
    //     setFormData(prev => ({ ...prev, [e.target.name]: e.target.value }));
    //   };

    const [formData, setFormData] = useState({
        FName: '',
        LName: '',
        Company: '',
        Email: '',
        PhoneNumber: '',
        Message: ''
    });

    const handleChange = (e) => {
        setFormData(prev => ({ ...prev, [e.target.name]: e.target.value }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        try {
            const response = await fetch('http://localhost:5000/InquiriesPost/submitInquiries', {
                method: 'POST',
                headers: { 'Content-Type': 'application/json' },
                body: JSON.stringify(formData)
            });

            if (response.ok) {
                const result = await response.json();
                // alert('Inquiry submitted successfully!');
                console.log(result);
                setFormData({
                    FName: '',
                    LName: '',
                    Company: '',
                    Email: '',
                    PhoneNumber: '',
                    Message: ''
                });
            } else {
                alert('Failed to submit inquiry');
            }
        } catch (error) {
            console.error('Error:', error);
            alert('Error submitting inquiry');
        }
    };

    return (
        <>
            <form action="#" method="POST" class="mx-auto mt-10 max-w-xl sm:mt-15" onSubmit={handleSubmit}>
                <div class="grid grid-cols-1 gap-x-8 gap-y-6 sm:grid-cols-2 flex w-full">
                    <div>
                        <label for="first-name" class="block text-sm/6 font-semibold text-gray-900">First name</label>
                        <div class="mt-2.5">
                            <input id="firstname" type="text" name="FName" autocomplete="given-name" placeholder='First Name' value={formData.FName} onChange={handleChange}
                                class="block w-full rounded-md bg-white px-3.5 py-2 text-base text-gray-900 outline-1 -outline-offset-1 outline-gray-300 placeholder:text-gray-400 focus:outline-2 focus:-outline-offset-2 focus:outline-indigo-600" />
                        </div>
                    </div>
                    <div>
                        <label for="last-name" class="block text-sm/6 font-semibold text-gray-900">Last name</label>
                        <div class="mt-2.5">
                            <input id="lastname" type="text" name="LName" autocomplete="family-name" placeholder='Last Name' value={formData.LName} onChange={handleChange}
                                class="block w-full rounded-md bg-white px-3.5 py-2 text-base text-gray-900 outline-1 -outline-offset-1 outline-gray-300 placeholder:text-gray-400 focus:outline-2 focus:-outline-offset-2 focus:outline-indigo-600" />
                        </div>
                    </div>
                    <div class="sm:col-span-2">
                        <label for="company" class="block text-sm/6 font-semibold text-gray-900">Company</label>
                        <div class="mt-2.5">
                            <input id="company" type="text" name="Company" autocomplete="organization" placeholder='Company Name' value={formData.Company} onChange={handleChange}
                                class="block w-full rounded-md bg-white px-3.5 py-2 text-base text-gray-900 outline-1 -outline-offset-1 outline-gray-300 placeholder:text-gray-400 focus:outline-2 focus:-outline-offset-2 focus:outline-indigo-600" />
                        </div>
                    </div>
                    <div class="sm:col-span-2">
                        <label for="email" class="block text-sm/6 font-semibold text-gray-900">Email</label>
                        <div class="mt-2.5">
                            <input id="email" type="email" name="Email" autocomplete="email" placeholder='Email' value={formData.Email} onChange={handleChange}
                                class="block w-full rounded-md bg-white px-3.5 py-2 text-base text-gray-900 outline-1 -outline-offset-1 outline-gray-300 placeholder:text-gray-400 focus:outline-2 focus:-outline-offset-2 focus:outline-indigo-600" />
                        </div>
                    </div>
                    <div class="sm:col-span-2">
                        <label for="phone-number" class="block text-sm/6 font-semibold text-gray-900">Phone number</label>
                        <div class="mt-2.5">
                            <div class="flex rounded-md bg-white outline-1 -outline-offset-1 outline-gray-300 has-[input:focus-within]:outline-2 has-[input:focus-within]:-outline-offset-2 has-[input:focus-within]:outline-indigo-600">
                                <input id="phone-number" type="text" name="PhoneNumber" placeholder="+63" value={formData.PhoneNumber} onChange={handleChange}
                                    class="block min-w-0 grow py-1.5 pr-3 pl-1 text-base text-gray-900 placeholder:text-gray-400 focus:outline-none sm:text-sm/6" />
                            </div>
                        </div>
                    </div>
                    <div class="sm:col-span-2 h-full">
                        <label for="message" class="block text-sm/6 font-semibold text-gray-900">Message</label>
                        <div class="mt-2.5">
                            <textarea id="message" name="Message" rows="4" placeholder='Remarks' value={formData.Message} onChange={handleChange}
                                class="block w-full rounded-md bg-white px-3.5 py-2 text-base text-gray-900 outline-1 -outline-offset-1 outline-gray-300 placeholder:text-gray-400 focus:outline-2 focus:-outline-offset-2 focus:outline-indigo-600"></textarea>
                        </div>
                    </div>
                </div>
                <div class="my-5 flex w-full h-full items-center justify-center">
                    <button type="submit" class="block w-full rounded-md bg-indigo-600 px-3.5 py-2.5 text-center text-sm font-semibold text-white shadow-xs hover:bg-indigo-500 focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-indigo-600">Let's talk</button>
                </div>
            </form>
        </>
    )
}
